import { useState, useEffect } from 'react';

const useTrashData = () => {
  const [trashData, setTrashData] = useState(null);

  useEffect(() => {
    (async () => {
      try {
        const response = await fetch(
          'https://api-dev-plastico.westeurope.cloudapp.azure.com/v1/geojson/-2.0/43.0/-1.0/44.0?entity_type=trash'
        );
        const data = await response.json();
        setData(data);
      } catch (error) {
        console.error(error);
        setError(error);
      }
    })();
  }, []);

  if (error) {
    return <div>An error occured: {error.message}</div>;
  }

  if (!data) {
    return <div>Loading...</div>;
  }

  return trashData;
};

export default TrashData;
